import React from 'react';
import './App.css';
import { Box } from '@mui/material';

function App() {
  return (
    <Box className='App'>
      <Box sx={{background: '#332F2F', width: '300px', height:'600px'}}>
        <Box sx={{background: '#332F2F', width: '300px', height:'200px', borderTopLeftRadius:'20px',borderTopRightRadius:'20px'}}></Box>
        <Box sx={{background: '#ffffff', width: '300px', height:'400px', borderRadius:'20px'}}></Box>
      </Box>
    </Box>
  );
}

export default App;
